-- FIRST OF ALL CREATE TABLE IN YOUR DATABASE
DROP TABLE IF EXISTS Week2Surveys;

create table Week2Surveys (
	id INT PRIMARY KEY NOT NULL,
	building TEXT,
	energy INT,
	ber TEXT,
	surveyTS TIMESTAMP,
	surveyCode TEXT
);


-- EXAMPLES

-- write an SQL query to return all rows where the surveyCode has a
-- digit at the start of the last block?
select surveycode from week2surveys where (surveycode ~ '^.*-.*-\d.*$');

-- write an SQL query to return all rows 
-- where the surveyCode starts and ends with a VOWEL (case insensitive)?
select * from week2surveys where (surveycode ~* '^(a|e|u|i|o|).*(a|e|u|i|o|e)$');

-- write an SQL query to return all rows where the surveyCode starts and
-- ends with a VOWEL (case insensitive
select * from week2surveys where (surveycode ~ '^.*-(0|2|4|6|8){3}-.*');

-- write an SQL query to return all rows where the surveyCode contains ONE or 
-- more consecutive uppercase G characters in first block AND 
-- the energy is an even number
select * from week2surveys where (surveycode ~ '^.*G{1,}.*-.*-.*$') and (energy % 2 = 0);

-- write a to return all rows where the surveyCode
-- contains a middle block where IF THE DIGITS are considered
-- as a number – the number is LESS THAN 800
select * from week2surveys where (surveycode !~ '^.*-(8|9)\d\d-.*');